 const [movies,setMovies]=useState([])
  const API=`http://www.omdbapi.com/?apikey=a1848174&s=titanic`
  useEffect(()=>{
   fetch(API)
   .then((response)=>response.json())
   .then((data)=>setMovies(data.Search))
    

  },[])
   
  return (
    <>
    {
      movies.map((curr)=>{
        return <>
        <div>{curr.Title}</div>
        </>
      })
    }
 
  
    

    </>
  );
}

